import React from 'react';
import temple from '../img/temple-mini.png'

const headerStyle = {
    fontSize: "48px",
    fontFamily: "comic sans"
}

const style = {
    color: '#ffffff',
    backgroundColor: '#9e3500',
    backgroundImage: `url(${temple})`,
    backgroundSize: '100%',
    backgroundRepeat: 'no-repeat',
    minHeight: '410px',
};

export default function Home() {
    return (
        <div style={style}>
            <div style={headerStyle}>Explore a<br></br>new museum experience</div>
        </div>
    );
}
